dS_m = S - T;
%calcula o gradiente da ativao
dZ_m = (Z_m> 0).* 1;
dZ_m = dZ_m .* dS_m;
%calcula o gradiente de entrada
dA_m = A*0;
for z =1:size(A,3)
  for l = 1:size(W,3)
    for x = 1:size(Z,1)
      for y = 1:size(Z,2)
      dA_m(1+(x-1)*px:(x-1)*px+size(W,1),(y-1)*py+1:(y-1)*py+size(W,2),z)  = dA_m(1+(x-1)*px:(x-1)*px+size(W,1),(y-1)*py+1:(y-1)*py+size(W,2),z) + W(:,:,l) .* dZ_m(x,y,(l-1)*size(A,3)+z);   
      end
    end
  end
end
%calcula o gradiente dos pesos
dW_m = W*0;
for z =1:size(A,3)
  for l = 1:size(W,3)
    for x = 1:size(Z,1)
      for y = 1:size(Z,2)
      dW_m(:,:,l) = dW_m(:,:,l) + A(1+(x-1)*px:(x-1)*px+size(W,1),(y-1)*py+1:(y-1)*py+size(W,2),z) *dZ_m(x,y,(l-1)*size(A,3)+z);
      end
    end
  end
end
figure
for i = 1:size(dW,3)
	subplot(size(dW,3),1,i);hold on;
	plot(dW(:,:,i)(:))
	plot(dW_m(:,:,i)(:))
end
suptitle(sprintf('dW vs dW_m erro = %f',var((dW - dW_m)(:))));
